import styled from 'styled-components';

const HomePageStyles = styled.div`
  background-image: url('https://res.cloudinary.com/utime/image/upload/v1614854500/UTime/kaboompics_Books_-_Coffee_-_Cinnamon_Roll_dwahl1.jpg') no-repeat;
  min-height: 500px;
  text-align: center;
  font-family: var(--textFont);
  font-size: 3em;
  padding-top: 100px;
`;

const HomePage = () => (
  <HomePageStyles>
    Make a coffee.
    <br />
    Light a candle.
    <br />
    Open a book.
    <br />
    This is your moment.
  </HomePageStyles>
);

export default HomePage;
